import React from 'react'

export default function Admin() {
    return (
        <div>
            <div className='container mt-2'>
                <h3>Admin Panel</h3>
            </div>
            <div className="container text-center">
                <h2 className='border border-top-0 border-dark'>Vote Count</h2>
            </div>
        </div>
    )
}
